  \"southcentral-alaska-small-hydroelectric-projects-reconnaissance-phase-planning-aid-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Planning Aid Report is based on information
  gathered from: (1) Kings River, (2) Tonsina River Tributary, (3) Placer River, (4)
  Bear Creek, and (5) Windy River. Specific. Tasks to be discussed are: 1. Description
  of species or areas of particular environmental concern; 2. A literature search
  on the fish and wildlife resources of the proposed project site; 3. Identification
  of any information gaps and associated advanced environmental studies required for
  mitigation and enhancement measure recommendations; 4. Identification of potential
  significant impacts in regard to fish and wildlife; 5. Discussion of the future
  without the project conditions; and 6. Preliminary recommendations of locations
  for diversion structures, powerhouse sites, and access roads/transmission corridors
  which would cause the least environmental damage.\",\n\t\"license_title\": \"License
